INSERT INTO `tb_question` (`id_question`, `kode_soal`, `isi_pertanyaan`) VALUES
(1, 'A1_Score', 'Saya sering memperhatikan detail-detail kecil yang orang lain sering lewatkan.'),
(2, 'A2_Score', 'Saya lebih suka melakukan aktivitas yang sama berulang kali daripada mencoba hal baru.'),
(3, 'A3_Score', 'Saya merasa mudah untuk memahami apa yang dipikirkan atau dirasakan orang lain hanya dengan melihat wajah mereka.'),
(4, 'A4_Score', 'Saya merasa kesulitan untuk memulai percakapan baru dengan orang lain.'),
(5, 'A5_Score', 'Saya sering mendapat komentar bahwa cara bicara saya terlalu detail atau formal.'),
(6, 'A6_Score', 'Saya mudah \"nyambung\" atau pandai saat melakukan obrolan ringan (social chitchat).'),
(7, 'A7_Score', 'Saya cenderung sangat tertarik pada suatu topik tertentu secara mendalam.'),
(8, 'A8_Score', 'Saat membaca cerita fiksi, saya merasa sulit untuk membayangkan seperti apa rupa karakternya.'),
(9, 'A9_Score', 'Saya bisa dengan mudah mengetahui jika seseorang yang mendengarkan saya mulai merasa bosan.'),
